import React from 'react';
import {Link} from 'react-router-dom'

function Navbar() {
    return (
        <div className="nav">
            <p>HOME</p>
            <p>PRODUCTS</p>
            <p>REQUESTS</p>
            <p>STOCK</p>
        </div>
    )
}

export default Navbar
